import React from 'react';
import LevelItem from './LevelItem'; // Assuming LevelItem component

function LevelBanner({ category, currentLevel }) {
  const filteredLevels = category.levels.filter(
    (level) => level.id >= currentLevel.minLevel && level.id <= currentLevel.maxLevel
  );

  return (
    <>
      <div className={`relative ${category.difficulty} text-white w-2/3 rounded-lg px-5 py-4 mx-auto mt-7`}>
        <h2 className='font-bold text-3xl text-white'>{category.title}</h2>
        <p className='font-semibold text-blue-100'>{category.description}</p>
        {/* ... (other elements for the banner) */}
      </div>
      <ul className="mt-5 text-center">
        {filteredLevels.map((level) => (
          <LevelItem key={level.id} level={level} currentLevel={currentLevel} />
        ))}
      </ul>
    </>
  );
}

export default LevelBanner;
